import React from 'react';
import './FilterSection.css';

function FilterSection() {
  return (
    <div className='px-12 py-5 mx-24 mt-5'>
      <div className='flex justify-between'>
        <h1 className='text-4xl font-semibold'>Search properties to rent</h1>
        <input type="search" id="default-search" class="block p-4 h-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:ring-violet-400 focus:border-violet-500" placeholder="Search" required />
      </div>
    </div>
  )
}

export default FilterSection
